syntax = "proto3";
option java_package="com.newbit.common.proto.option";
option java_outer_classname = "OptionsProto";

message Options{

   repeated Option list = 1;

  message Option{
    string high = 1;
    string low = 2;
    string volume = 3;
    string last = 4;
    string open = 5;
    string chg = 6;
    int64 time = 7; //时间
    string quoteVolume = 8;
    string symbol = 9;
    string optionId = 10;
  }

}